    public static boolean closeStrings(String word1, String word2) {

        if (word1.length() != word2.length()) {
            return false;
        }

        if (word1 == word2) {
            return true;
        }

        int[] intArr1 = new int[26];
        int[] intArr2 = new int[26];
//        Arrays.fill(intArr1, 0);
//        Arrays.fill(intArr2, 0);
        //統計

//        951917NS
        for (char c : word1.toCharArray()) {
            intArr1[(int) c-'a']++;
        }
        for (char c : word2.toCharArray()) {
            intArr2[(int) c-'a']++;
        }
//        82648834NS
//        for (int i = 0; i < word2.length(); i++) {
//            intArr1[word1.toCharArray()[i]-'a']++;
//            intArr2[word2.toCharArray()[i]-'a']++;
//
////            c1(word1,i,intArr1);
////            c2(word2,i,intArr2);
//        }



        for (int i = 0; i < 26; i++) {
            //比較出現字母 字母要相同 不然換不過去
            if ((intArr1[i] != 0 && intArr2[i] == 0) || intArr1[i] == 0 && intArr2[i] != 0) {
                return  false;
//        比較數量
            }
        }
        Arrays.sort(intArr1);
        Arrays.sort(intArr2);
        if (!Arrays.equals(intArr1,intArr2)) {
            return false;
        }
//        if (!Arrays.toString(intArr1).equals(Arrays.toString(intArr2))) return false;
        return true;
    }
